import React from "react";
import noResult from '../../Images/NoResults.png'

function NoResult() {
  const styleNoResultDiv = {
    backgroundColor: "red",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    width: "100vw",
    height: "50vh",
  };

  return (
    <div style={styleNoResultDiv}>
      <img src={noResult} alt={"noResult"}/>
      <h1>No Result Found !!</h1>
    </div>
  );
}

export default NoResult;
